import React, {Fragment, useState} from 'react'

export default function InputToDo() {

    const [input, setInput] = useState(""); //initializing the input

    const updateInputField = (event) => {
        setInput(event.target.input);
    };

    setInput(""); //re-initializing the input

    return (
            <button>+</button>
    )
}
